-- Table Schema
CREATE TABLE trips (
    id character varying(255) NOT NULL,
    vendor_id integer,
    pickup_datetime timestamp without time zone,
    dropoff_datetime timestamp without time zone,
    passenger_count integer,
    pickup_longitude numeric(10,7),
    pickup_latitude numeric(10,7),
    dropoff_longitude numeric(10,7),
    dropoff_latitude numeric(10,7),
    store_and_fwd_flag character,
    trip_duration integer,
    distance_km numeric(10,7),
    speed_kmh numeric(10,7),
    fare_per_km numeric(10,7),
    hour_of_day integer,
    day_of_week integer,
    month integer,
    pickup_borough character varying(255),
    dropoff_borough character varying(255),
    trip_type character varying(255),
    created_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP
);

-- Indexes
CREATE INDEX idx_trips_pickup_borough ON trips(pickup_borough);
CREATE INDEX idx_trips_hour_of_day ON trips(hour_of_day);
CREATE INDEX idx_trips_trip_duration ON trips(trip_duration);
CREATE INDEX idx_trips_pickup_coords ON trips(pickup_latitude, pickup_longitude);
CREATE INDEX idx_trips_datetime ON trips(pickup_datetime);
CREATE INDEX idx_trips_trip_type ON trips(trip_type);

